_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "Couple of bug fixes & a couple of minor changes to the code implemented\
    \ by PR #5118.\r\n\r\nI couldn't get the  **#define PINSET(P) (defined(P) && P\
    \ > -1)**  from the previous review to work on a pin that existed.  Really strange\
    \ since it uses the same method as the PIN_EXISTS macro.\r\n\r\n----\r\n\r\nWhen\
    \ determining if a pin is connected to a PWM, the TCCRxA register is always used\
    \ even if looking at TIMERxC\r\n\r\nLines 677-680 need to change\r\n```\r\n#define\
    \ PWM_CASE(N) \\\r\n  case TIMER##N: \\\r\n    if (TCCR##N & (_BV(COM## N ##1)\
    \ | _BV(COM## N ##0))) { \\\r\n      PWM_PRINT(OCR##N); \\\r\n```\r\nThe solution\
    \ I came up with is a two part change:\r\nLines 677-680  now read\r\n```\r\n#define\
    \ PWM_CASE(N,Z) \\\r\n  case TIMER##N##Z: \\\r\n    if (TCCR##N ##A & (_BV(COM##\
    \ N ## Z ##1) | _BV(COM## N ## Z ##0))) { \\\r\n      PWM_PRINT(OCR##N ## Z);\
    \ \\\r\n```\r\nwhich means 694-724 change from\r\n`PWM_CASE(0A);`\r\nto\r\n`PWM_CASE(0,A);`\r\
    \n\r\n----\r\n\r\nIn the WGM_MAKE macros the TEST function only returns 1 or 0\
    \ so the following pieces in lines 734-735 need to change from\r\n```\r\nTEST(TCCR##N##B,\
    \ WGM##N##2) >> 1\r\nTEST(TCCR##N##B, WGM##N##3) >> 1\r\n```\r\n to either \r\n\
    ```\r\nTEST(TCCR##N##B, WGM##N##2) << 2\r\nTEST(TCCR##N##B, WGM##N##3) << 3\r\n\
    ```\r\nor\r\n```\r\nTCCR##N##B & _BV(WGM##N##2)) >> 1\r\nTCCR##N##B & _BV(WGM##N##3))\
    \ >> 1\r\n```\r\nI prefer the latter because it's one less operation to perform\
    \ and it's consistent with how the macros treat the other register.\r\n\r\n----\r\
    \n\r\nA couple of minor changes:\r\n\r\n- buffer[30] changed to buffer[40] per\
    \ review in previous PR\r\n\r\n- added name length to comment on line 75\r\n`//\
    \ Pin list updated from 7 OCT RCBugfix branch   - max length of pin name is 24`\r\
    \n"
